    false,nt"url": null,nt"notes": "This dataset is one of a collection of
    three land cover maps of the Willamette Valley of Oregon, USA, depicting 4 habitat
    classes: wet with <= 50% vegetation cover (class 1), wet with >50% vegetation (class
    2), dry with <= 50% vegetation (class 3), dry with >50% vegetation (class 4). Land
    cover maps were derived by classifying signatures from C-band (5.6 cm wavelength),
    HH-polarized radar remote sensing (RADARSAT) data collected at a 38 degree incidence
    angle (8-m resolution). The data are in the form of an ERDAS Imagine image.",nt"license_title":
